import React from 'react';

export default function Home({onChoose,onRegister}){
  return (
    <div>
      <h1>Kiosk Printing</h1>
      <p>Welcome! Choose login type or register.</p>
      <div style={{display:'flex',gap:10}}>
        <button onClick={()=>onChoose('kiosk')}>Kiosk Login</button>
        <button onClick={()=>onChoose('user')}>User Login</button>
        <button onClick={onRegister}>Register</button>
      </div>
    </div>
  );
}
